import React,{useState,useEffect} from 'react'
import MurPiece from "./MurPiece"

const CasePiece = ({
   
}) => {
    
    const renderMurs=()=>{

        return (
            <>
                <MurPiece  num={0}/>
                <MurPiece num={1}/>
                <MurPiece num={2}/>
                <MurPiece num={3}/>
            </>
        )
    }
  
   
    return ( 
        <div 
            className='case-piece'  
        >
           { renderMurs()}

        </div>

    );
}
 
export default CasePiece;
